import React, { useEffect, useState } from "react";

const OyuncuDetay = ({onClick}) =>{

    const genreClick = (id) =>{
        onClick(id)
    }

    const [oyuncu , setOyuncu]=useState([]);

    useEffect(() =>{
        const api_link="https://cryptic-gorge-72989.herokuapp.com/players"
        fetch(api_link)
        .then(oyuncu=>oyuncu.json())
        .then(oyuncu=>{
            setOyuncu(oyuncu)
        })
    })
    return(
        <div>
            <div>
                {
                    oyuncu.map(takımici=>
                        <div>
                           <p> onClick={() => genreClick(takı.id)} {takımici.name}</p> 
                        </div>
                        )
                }
            </div>

        </div>
    )
}
export default OyuncuDetay;
